    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    NWR outlines Refuge accomplishments from September through December of 1959. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including waterfowl, upland game birds, big game animals,
    furbearers, and rodents- is also covered. The Refuge development and maintenance
    section discusses physical developments. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes hunting and fishing.",nt"license_title": "License Not Specified",nt"extras":
